import SearchBar from "./SearchBar";
import Grid from '@material-ui/core/Grid';
import "./StartingPage.css";
import Button from '@material-ui/core/Button';
import SearchIcon from '@material-ui/icons/Search';
import { Link, useHistory } from 'react-router-dom';
import { useState } from "react";


function SearchBarContainer() {

  let history = useHistory();
  const [originCity, setOriginCity] = useState("");
  const [destinationCity, setDestinationCity] = useState("");
  const [validSearch, setValidSearch] = useState(false);

  function submitSearch() {
    history.push("/search");
  }

    return <div>
    <Grid container direction="row" justify="center" spacing={5} >
      <Grid item>
        <SearchBar name="originSearchBar" label="Origin city" setCity={setOriginCity}/>
      </Grid>
      <Grid item>
        <SearchBar name="destinationSearchBar" label="Desination city" setCity={setDestinationCity}/>
      </Grid>
    </Grid>

    <Button disabled={!validSearch} variant="contained" className="searchButton" onClick={submitSearch}> <SearchIcon className="searchIcon"/> Search for flights</Button>

    </div>;
}

export default SearchBarContainer;
